import React, { Component } from "react";
import "./Mission.css";
import { } from 'react-bootstrap';

export default class Mission extends Component {  
  constructor(props) {
    super(props);
    this.state = {}    
  }

  render() {
   
    return (
      <div>
        <p>
            This will be the mission statement. 
        </p>
      </div>
    );
  }
}
